<div class="main-topbar group/topbar"
    :class="{ 'navbar': true, 'group-data-[layout=boxed]:top-0 group-data-[layout=semibox]:top-0 nav-sticky': scrolled }">
    <div
      class="main-topbar-wrapper group-data-[nav-type=pattern]:group-[&.nav-sticky]/topbar:bg-primary-500 group-data-[nav-type=pattern]:group-[&.nav-sticky]/topbar:border-primary-400">
      <div class="flex items-center w-full ltr:pr-4 rtl:pl-4">
        <div class="navbar-brand">
          <div class="logos">
            <a href="index.html"><img src="assets/images/main-logo.png" aria-label="Read more about Seminole tax hike"
                alt="" class="h-6 group-data-[layout=modern]:hidden inline-block dark:hidden" />
              <img src="assets/images/logo-white.png" aria-label="Read more about Seminole tax hike" alt=""
                class="h-6 hidden dark:inline-block group-data-[layout=modern]:hidden" /></a>
          </div>
          <button x-on:click="toggleSidebar()" class="sidebar-toggle" title="sidebar-toggle">
            <i data-lucide="panel-right-open" class="size-4"></i>
          </button>
        </div>
        <div class="relative items-center hidden lg:flex">
          <i data-lucide="search"
            class="absolute size-4 text-topbar top-3 ltr:left-2 rtl:right-2 group-data-[nav-type=pattern]:text-white/75"></i>
          <input type="search"
            class="border-0 w-72 ltr:pl-8 rtl:pr-8 form-input focus:outline-none group-data-[nav-type=pattern]:bg-transparent group-data-[nav-type=pattern]:placeholder:text-white/50 group-data-[nav-type=pattern]:text-white"
            placeholder="Search for Domiex" @input="$dispatch('search-data', { term: $event.target.value })" />
        </div>
        <div class="flex items-center gap-2 ltr:ml-auto rtl:mr-auto">
          <button class="hidden topbar-link md:flex" id="settingsModalButton" title="topbar-link" type="button"
            data-modal-target="settingsModal">
            <i data-lucide="settings" class="size-4"></i>
          </button>
          <button class="topbar-link" title="topbar-link"
            @click="setLayoutMode(layoutMode === 'light' ? 'dark' : 'light')">
            <i data-lucide="moon" class="size-4 dark:hidden"></i>
            <i data-lucide="sun" class="hidden size-4 dark:inline-block"></i>
          </button>
          <button class="hidden topbar-link sm:flex" title="tools-apps-modal" data-modal-target="toolsAppsModal">
            <i data-lucide="layout-grid" class="size-4"></i>
          </button>
          <div x-data="dropdownBehavior()" x-on:keydown.escape.prevent.stop="close()" x-on:focusin.window="close()"
            x-init="calculatePosition()" class="dropdown">
            <button x-ref="button" title="topbar-link" x-on:click="toggle()" :aria-expanded="open.toString()"
              type="button" class="topbar-link">
              <span class="relative"><i data-lucide="bell-ring" class="size-4"></i>
                <div
                  class="absolute top-0 -mt-1 bg-green-500 rounded-full ltr:-mr-1 rtl:-ml-1 ltr:right-0 rtl:left-0 size-2 animate-ping">
                </div>
                <div
                  class="absolute top-0 -mt-1 bg-green-500 rounded-full ltr:-mr-1 rtl:-ml-1 ltr:right-0 rtl:left-0 size-2">
                </div>
              </span>
            </button>
            <div x-ref="dropdown" x-show="open" x-transition.origin.top.left x-on:click.outside="close()"
              class="!fixed dropdown-menu notification-dropdown md:!w-96 hidden" dropdown-position="right">
              <div class="flex items-center gap-3 p-4">
                <h6 class="grow">Notification (4)</h6>
                <a href="#!" class="text-sm shrink-0 link link-primary">Mark All as read</a>
              </div>
              <div class="py-4 border-t border-gray-200 dark:border-dark-800">
                <div data-simplebar class="px-4 max-h-[calc(100vh_-_170px)]">
                  <div class="space-y-3">
                    <a href="#!"
                      class="relative flex gap-3 p-2 transition duration-300 ease-linear rounded-md hover:bg-gray-100 [&.unread]:bg-gray-100 dark:[&.unread]:bg-dark-850 dark:hover:bg-dark-850 unread"><img
                        src="assets/images/user-10.png" alt="" class="rounded-full size-7 shrink-0" />
                      <div class="grow">
                        <p class="mb-0.5 text-sm">
                          <span class="font-medium">Donna Berlin</span> wants
                          to edit Domiex Admin & dashboards
                        </p>
                        <p class="text-xs text-gray-500 dark:text-dark-500">
                          5 min ago
                        </p>
                      </div>
                    </a><a href="#!"
                      class="relative flex gap-3 p-2 transition duration-300 ease-linear rounded-md hover:bg-gray-100 [&.unread]:bg-gray-100 dark:[&.unread]:bg-dark-850 dark:hover:bg-dark-850"><img
                        src="assets/images/user-11.png" alt="" class="rounded-full size-7 shrink-0" />
                      <div class="grow">
                        <p class="mb-0.5 text-sm">
                          <span class="font-medium">Liam Clark</span>
                          commented in domiex
                        </p>
                        <p class="text-xs text-gray-500 dark:text-dark-500">
                          8 min ago
                        </p>
                        <p class="mt-3 text-sm line-clamp-2">
                          " Greetings, I'm making blazor web assembly app /
                          MAUI. Does your template available for this? "
                        </p>
                      </div>
                    </a><a href="#!"
                      class="relative flex gap-3 p-2 transition duration-300 ease-linear rounded-md hover:bg-gray-100 [&.unread]:bg-gray-100 dark:[&.unread]:bg-dark-850 dark:hover:bg-dark-850">
                      <div
                        class="flex items-center justify-center text-xs text-gray-500 bg-gray-100 rounded-full size-7 shrink-0">
                        LN
                      </div>
                      <div class="grow">
                        <p class="mb-0.5 text-sm">
                          <span class="font-medium">Lucas Nguyen</span>
                          competed create new components
                        </p>
                        <p class="text-xs text-gray-500 dark:text-dark-500">
                          01:15 PM
                        </p>
                      </div>
                    </a><a href="#!"
                      class="relative flex gap-3 p-2 transition duration-300 ease-linear rounded-md hover:bg-gray-100 [&.unread]:bg-gray-100 dark:[&.unread]:bg-dark-850 dark:hover:bg-dark-850"><img
                        src="assets/images/user-18.png" alt="" class="rounded-full size-7 shrink-0" />
                      <div class="grow">
                        <p class="mb-0.5 text-sm">
                          <span class="font-medium">James Taylor</span> marked
                          your order.
                        </p>
                        <span class="mb-2 badge badge-primary">Completed</span>
                        <p class="text-xs text-gray-500 dark:text-dark-500">
                          03:57 AM
                        </p>
                      </div>
                    </a>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div x-data="dropdownBehavior()" x-init="calculatePosition()" class="dropdown">
            <button x-ref="button" title="topbar-link" x-on:click="toggle()" :aria-expanded="open.toString()"
              type="button" class="topbar-link">
              <img :src="getFlag()" alt="" class="object-cover rounded-full size-6" />
            </button>
            <div x-ref="dropdown" x-show="open" x-transition.origin.top.left x-on:click.outside="close()"
              class="!fixed dropdown-menu p-2 hidden" dropdown-position="left">
              <div data-simplebar class="max-h-[calc(100vh_-_100px)]">
                <template x-for="(value, key) in $data.languages" :key="key+'flags'"><a href="#!" class="dropdown-item"
                    @click="updateLanguage(key)"><img :src="value.flag" :alt="key"
                      class="object-cover rounded-md size-5" />
                    <span x-text="value.name"></span></a></template>
              </div>
            </div>
          </div>
          <div x-data="dropdownBehavior()" x-init="calculatePosition()" class="dropdown">
            <button x-ref="button" title="topbar-link" x-on:click="toggle()" :aria-expanded="open.toString()"
              type="button" class="topbar-link">
              <img src="assets/images/user-11.png" alt="" class="object-cover rounded-full size-6" />
            </button>
            <div x-ref="dropdown" x-show="open" x-transition.origin.top.left x-on:click.outside="close()"
              class="!fixed dropdown-menu p-0 hidden !w-72" dropdown-position="left">
              <div class="p-4">
                <div class="flex items-center gap-3 mb-4">
                  <img src="assets/images/user-11.png" alt="" class="rounded-md size-11" />
                  <div>
                    <h6 class="mb-0.5">Samuel Martin</h6>
                    <p class="flex items-center gap-2 text-gray-500 dark:text-dark-500">
                      <span class="inline-block align-baseline bg-green-500 rounded-full size-2"></span>
                      Active
                    </p>
                  </div>
                </div>
                <a href="apps-school-students-admission.html"
                  class="flex items-center gap-2 w-full first-of-type:rounded-t-md last-of-type:rounded-b-md px-4 py-2.5 text-sm hover:bg-gray-50 dark:hover:bg-dark-850"><i
                    class="align-baseline ltr:mr-1 rtl:ml-1 lab la-wpforms"></i>
                  Admission Form </a><a href="apps-school-teachers-payroll.html"
                  class="flex items-center gap-2 w-full first-of-type:rounded-t-md last-of-type:rounded-b-md px-4 py-2.5 text-sm hover:bg-gray-50 dark:hover:bg-dark-850"><i
                    class="align-baseline ltr:mr-1 rtl:ml-1 las la-receipt"></i>
                  Payroll </a><a href="apps-school-attendances-students.html"
                  class="flex items-center gap-2 w-full first-of-type:rounded-t-md last-of-type:rounded-b-md px-4 py-2.5 text-sm hover:bg-gray-50 dark:hover:bg-dark-850"><i
                    class="align-baseline ltr:mr-1 rtl:ml-1 las la-calendar-check"></i>
                  Attendances </a><a href="pages-account-settings.html"
                  class="flex items-center gap-2 w-full first-of-type:rounded-t-md last-of-type:rounded-b-md px-4 py-2.5 text-sm hover:bg-gray-50 dark:hover:bg-dark-850"><i
                    class="align-baseline ltr:mr-1 rtl:ml-1 las la-user-tie"></i>
                  Account Settings</a>
              </div>
              <div class="flex items-center gap-2 p-4 border-purple-500/20 border-y bg-purple-500/10">
                <img
                  src="data:image/png;base64,"
                  alt="" class="size-8 shrink-0" />
                <div class="grow">
                  <h6 class="mb-0.5">Refer a friend</h6>
                  <p class="text-gray-500 dark:text-dark-500">
                    7 invitation remaining
                  </p>
                </div>
              </div>
              <div class="p-4">
                <a href="auth-signin-basic.html"
                  class="flex items-center gap-2 w-full first-of-type:rounded-t-md last-of-type:rounded-b-md px-4 py-2.5 text-sm hover:bg-gray-50 dark:hover:bg-dark-850"><i
                    class="align-baseline ltr:mr-1 rtl:ml-1 ri-logout-circle-r-line"></i>
                  Sign Out</a>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  </div>

